import React from 'react';
import Typed from 'react-typed';
const Header = () => {
  return (
    <div className='header-wrap'>
      <div className='main_text'>
          <Typed
          className ="typed_hello"
          strings={["Hello Folks! I'm"]}
          typeSpeed={40}/>
        <Typed
        className="type_name"
        strings={["Krishna Sai Surendra Babu Kalluri"]}
        typeSpeed={40}/>
        <Typed
        className="typed_job"
        strings={["Front End Developer, Working with React, React-Native, Node and other."]}
        typeSpeed={40}
        loop/>
      </div>
    </div>
  );
};

export default Header;
